import React from "react";

class Button extends React.Component {
  render() {
    const numbers = [1, 2, 3, 4, 5];
    const buttonloop = numbers.map((number) => {
      return <button key={number}>{number}</button>;
    });
    return { buttonloop };
  }
}

export default Button;
